import React, { Component } from 'react';
import './app-header.css';

export default class AppHeader extends Component {

    render() {
        return (
            <div className="app-header">
                <nav className="menu">
                    <ul className="list-menu">
                        <li className="item-menu"></li> 
                        <li className="item-menu"></li> 
                        <li className="item-menu"></li> 
                        <li className="item-menu"></li> 
                    </ul>
                    
                </nav>

                <h1>Hello world</h1>
                
                <div>
                    You
                </div>
            </div>   
        );
    };
};
